import './content'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBell } from '@fortawesome/free-solid-svg-icons'

function HeaderBar() {
    return ( 
        <div className='headerbar'>
            <span>Status:</span>
            <select className='status'>
                <option>Sale</option>
                <option>...</option>
            </select>

        </div>
    );
}

export default HeaderBar;
